    false,nt"url": null,nt"notes": "This Inventory and Monitoring Plan for
    Little River National Wildlife Refuge is a step-down from the Comprehensive Conservation
    Plan and Forest Habitat Management Plan (FHMP) and documents the inventory and monitoring
    surveys that will be conducted from 2013 through 2028, or until the refugeu2019s
    Comprehensive Conservation Plan and FHMP are revised. The majority of surveys considered
    in this plan address resource management objectives identified in the FHMP (2012)
    for this refuge. Other surveys are conducted for the purpose of understanding long-term
    trends in specific resources or are part of regional and national survey efforts.",nt"license_title":
